export default class ClassComponentExample extends Component {
    constructor(props){
        super(props);
        this.Student={
            Nane:Krishna,
            SurName:Patidar
        }
    }
  render() {
    return (
        <>
      <div>ClassComponentExample</div>
      <div>{this.Student.Krishna}</div>
      </>
    )
  }
}
